                    "will \r\n# generate HTML output.\r\n\r\nGENERATE_HTML          = NO\r\n\r\n# The HTML_OUTP" +
                    "UT tag is used to specify where the HTML docs will be put. \r\n# If a relative pat" +
                    "h is entered the value of OUTPUT_DIRECTORY will be \r\n# put in front of it. If le" +
                    "ft blank `html\' will be used as the default path.\r\n\r\nHTML_OUTPUT            = \r\n" +
                    "\r\n# The HTML_FILE_EXTENSION tag can be used to specify the file extension for \r\n" +
                    "# each generated HTML page (for example: .htm,.php,.asp). If it is left blank \r\n" +
                    "# doxygen will generate files with .html extension.\r\n\r\nHTML_FILE_EXTENSION    = " +
                    ".html\r\n\r\n# The HTML_HEADER tag can be used to specify a personal HTML header for" +
                    " \r\n# each generated HTML page. If it is left blank doxygen will generate a \r\n# s" +
                    "tandard header. Note that when using a custom header you are responsible  \r\n# fo" +
                    "r the proper inclusion of any scripts and style sheets that doxygen \r\n# needs, w" +
                    "hich is dependent on the configuration options used. \r\n# It is advised to genera" +
                    "te a default header using \"doxygen -w html \r\n# header.html footer.html styleshee" +
                    "t.css YourConfigFile\" and then modify \r\n# that header. Note that the header is s" +
                    "ubject to change so you typically \r\n# have to redo this when upgrading to a newe" +
                    "r version of doxygen or when \r\n# changing the value of configuration settings su" +
                    "ch as GENERATE_TREEVIEW!\r\n\r\nHTML_HEADER            = \r\n\r\n# The HTML_FOOTER tag c" +
                    "an be used to specify a personal HTML footer for \r\n# each generated HTML page. I" +
                    "f it is left blank doxygen will generate a \r\n# standard footer.\r\n\r\nHTML_FOOTER  " +
                    "          = \r\n\r\n# The HTML_STYLESHEET tag can be used to specify a user-defined " +
                    "cascading \r\n# style sheet that is used by each HTML page. It can be used to \r\n# " +
                    "fine-tune the look of the HTML output. If left blank doxygen will \r\n# generate a" +
                    " default style sheet. Note that it is recommended to use \r\n# HTML_EXTRA_STYLESHE" +
                    "ET instead of this one, as it is more robust and this \r\n# tag will in the future" +
                    " become obsolete.\r\n\r\nHTML_STYLESHEET        = \r\n\r\n# The HTML_EXTRA_STYLESHEET ta" +
                    "g can be used to specify an additional \r\n# user-defined cascading style sheet th" +
                    "at is included after the standard \r\n# style sheets created by doxygen. Using thi" +
                    "s option one can overrule \r\n# certain style aspects. This is preferred over usin" +
                    "g HTML_STYLESHEET \r\n# since it does not replace the standard style sheet and is " +
                    "therefor more \r\n# robust against future updates. Doxygen will copy the style she" +
                    "et file to \r\n# the output directory.\r\n\r\nHTML_EXTRA_STYLESHEET  = \r\n\r\n# The HTML_" +
                    "EXTRA_FILES tag can be used to specify one or more extra images or \r\n# other sou" +
                    "rce files which should be copied to the HTML output directory. Note \r\n# that the" +
                    "se files will be copied to the base HTML output directory. Use the \r\n# $relpath$" +
                    " marker in the HTML_HEADER and/or HTML_FOOTER files to load these \r\n# files. In " +
                    "the HTML_STYLESHEET file, use the file name only. Also note that \r\n# the files w" +
                    "ill be copied as-is; there are no commands or markers available.\r\n\r\nHTML_EXTRA_F" +
                    "ILES       = \r\n\r\n# The HTML_COLORSTYLE_HUE tag controls the color of the HTML ou" +
                    "tput. \r\n# Doxygen will adjust the colors in the style sheet and background image" +
                    "s \r\n# according to this color. Hue is specified as an angle on a colorwheel, \r\n#" +
                    " see http://en.wikipedia.org/wiki/Hue for more information. \r\n# For instance the" +
                    " value 0 represents red, 60 is yellow, 120 is green, \r\n# 180 is cyan, 240 is blu" +
                    "e, 300 purple, and 360 is red again. \r\n# The allowed range is 0 to 359.\r\n\r\nHTML_" +
                    "COLORSTYLE_HUE    = 220\r\n\r\n# The HTML_COLORSTYLE_SAT tag controls the purity (or" +
                    " saturation) of \r\n# the colors in the HTML output. For a value of 0 the output w" +
                    "ill use \r\n# grayscales only. A value of 255 will produce the most vivid colors.\r" +
                    "\n\r\nHTML_COLORSTYLE_SAT    = 100\r\n\r\n# The HTML_COLORSTYLE_GAMMA tag controls the " +
                    "gamma correction applied to \r\n# the luminance component of the colors in the HTM" +
                    "L output. Values below \r\n# 100 gradually make the output lighter, whereas values" +
                    " above 100 make \r\n# the output darker. The value divided by 100 is the actual ga" +
                    "mma applied, \r\n# so 80 represents a gamma of 0.8, The value 220 represents a gam" +
                    "ma of 2.2, \r\n# and 100 does not change the gamma.\r\n\r\nHTML_COLORSTYLE_GAMMA  = 80" +
                    "\r\n\r\n# If the HTML_TIMESTAMP tag is set to YES then the footer of each generated " +
                    "HTML \r\n# page will contain the date and time when the page was generated. Settin" +
                    "g \r\n# this to NO can help when comparing the output of multiple runs.\r\n\r\nHTML_TI" +
                    "MESTAMP         = YES\r\n\r\n# If the HTML_DYNAMIC_SECTIONS tag is set to YES then t" +
                    "he generated HTML \r\n# documentation will contain sections that can be hidden and" +
                    " shown after the \r\n# page has loaded.\r\n\r\nHTML_DYNAMIC_SECTIONS  = YES\r\n\r\n# With " +
                    "HTML_INDEX_NUM_ENTRIES one can control the preferred number of \r\n# entries shown" +
                    " in the various tree structured indices initially; the user \r\n# can expand and c" +
                    "ollapse entries dynamically later on. Doxygen will expand \r\n# the tree to such a" +
                    " level that at most the specified number of entries are \r\n# visible (unless a fu" +
                    "lly collapsed tree already exceeds this amount). \r\n# So setting the number of en" +
                    "tries 1 will produce a full collapsed tree by \r\n# default. 0 is a special value " +
                    "representing an infinite number of entries \r\n# and will result in a full expande" +
                    "d tree by default.\r\n\r\nHTML_INDEX_NUM_ENTRIES = 100\r\n\r\n# If the GENERATE_DOCSET t" +
                    "ag is set to YES, additional index files \r\n# will be generated that can be used " +
                    "as input for Apple\'s Xcode 3 \r\n# integrated development environment, introduced " +
                    "with OSX 10.5 (Leopard). \r\n# To create a documentation set, doxygen will generat" +
                    "e a Makefile in the \r\n# HTML output directory. Running make will produce the doc" +
                    "set in that \r\n# directory and running \"make install\" will install the docset in " +
                    "\r\n# ~/Library/Developer/Shared/Documentation/DocSets so that Xcode will find \r\n#" +
                    " it at startup. \r\n# See http://developer.apple.com/tools/creatingdocsetswithdoxy" +
                    "gen.html \r\n# for more information.\r\n\r\nGENERATE_DOCSET        = NO\r\n\r\n# When GENE" +
                    "RATE_DOCSET tag is set to YES, this tag determines the name of the \r\n# feed. A d" +
                    "ocumentation feed provides an umbrella under which multiple \r\n# documentation se" +
                    "ts from a single provider (such as a company or product suite) \r\n# can be groupe" +
                    "d.\r\n\r\nDOCSET_FEEDNAME        = \"Doxygen generated docs\"\r\n\r\n# When GENERATE_DOCSE" +
                    "T tag is set to YES, this tag specifies a string that \r\n# should uniquely identi" +
                    "fy the documentation set bundle. This should be a \r\n# reverse domain-name style " +
                    "string, e.g. com.mycompany.MyDocSet. Doxygen \r\n# will append .docset to the name" +
                    ".\r\n\r\nDOCSET_BUNDLE_ID       = org.doxygen.Project\r\n\r\n# When GENERATE_PUBLISHER_I" +
                    "D tag specifies a string that should uniquely \r\n# identify the documentation pub" +
                    "lisher. This should be a reverse domain-name \r\n# style string, e.g. com.mycompan" +
                    "y.MyDocSet.documentation.\r\n\r\nDOCSET_PUBLISHER_ID    = org.doxygen.Publisher\r\n\r\n#" +
                    " The GENERATE_PUBLISHER_NAME tag identifies the documentation publisher.\r\n\r\nDOCS" +
                    "ET_PUBLISHER_NAME  = Publisher\r\n\r\n# If the GENERATE_HTMLHELP tag is set to YES, " +
                    "additional index files \r\n# will be generated that can be used as input for tools" +
                    " like the \r\n# Microsoft HTML help workshop to generate a compiled HTML help file" +
                    " (.chm) \r\n# of the generated HTML documentation.\r\n\r\nGENERATE_HTMLHELP      = NO\r" +
                    "\n\r\n# If the GENERATE_HTMLHELP tag is set to YES, the CHM_FILE tag can \r\n# be use" +
                    "d to specify the file name of the resulting .chm file. You \r\n# can add a path in" +
                    " front of the file if the result should not be \r\n# written to the html output di" +
                    "rectory.\r\n\r\nCHM_FILE               = \r\n\r\n# If the GENERATE_HTMLHELP tag is set t" +
                    "o YES, the HHC_LOCATION tag can \r\n# be used to specify the location (absolute pa" +
                    "th including file name) of \r\n# the HTML help compiler (hhc.exe). If non-empty do" +
                    "xygen will try to run \r\n# the HTML help compiler on the generated index.hhp.\r\n\r\n" +
                    "HHC_LOCATION           = \r\n\r\n# If the GENERATE_HTMLHELP tag is set to YES, the G" +
                    "ENERATE_CHI flag \r\n# controls if a separate .chi index file is generated (YES) o" +
                    "r that \r\n# it should be included in the master .chm file (NO).\r\n\r\nGENERATE_CHI  " +
                    "         = NO\r\n\r\n# If the GENERATE_HTMLHELP tag is set to YES, the CHM_INDEX_ENC" +
                    "ODING \r\n# is used to encode HtmlHelp index (hhk), content (hhc) and project file" +
                    " \r\n# content.\r\n\r\nCHM_INDEX_ENCODING     = \r\n\r\n# If the GENERATE_HTMLHELP tag is " +
                    "set to YES, the BINARY_TOC flag \r\n# controls whether a binary table of contents " +
                    "is generated (YES) or a \r\n# normal table of contents (NO) in the .chm file.\r\n\r\nB" +
                    "INARY_TOC             = NO\r\n\r\n# The TOC_EXPAND flag can be set to YES to add ext" +
                    "ra items for group members \r\n# to the contents of the HTML help documentation an" +
                    "d to the tree view.\r\n\r\nTOC_EXPAND             = NO\r\n\r\n# If the GENERATE_QHP tag " +
                    "is set to YES and both QHP_NAMESPACE and \r\n# QHP_VIRTUAL_FOLDER are set, an addi" +
                    "tional index file will be generated \r\n# that can be used as input for Qt\'s qhelp" +
                    "generator to generate a \r\n# Qt Compressed Help (.qch) of the generated HTML docu" +
                    "mentation.\r\n\r\nGENERATE_QHP           = NO\r\n\r\n# If the QHG_LOCATION tag is specif" +
                    "ied, the QCH_FILE tag can \r\n# be used to specify the file name of the resulting " +
                    ".qch file. \r\n# The path specified is relative to the HTML output folder.\r\n\r\nQCH_" +
                    "FILE               = \r\n\r\n# The QHP_NAMESPACE tag specifies the namespace to use " +
                    "when generating \r\n# Qt Help Project output. For more information please see \r\n# " +
                    "http://doc.trolltech.com/qthelpproject.html#namespace\r\n\r\nQHP_NAMESPACE          " +
                    "= org.doxygen.Project\r\n\r\n# The QHP_VIRTUAL_FOLDER tag specifies the namespace to" +
                    " use when generating \r\n# Qt Help Project output. For more information please see" +
                    " \r\n# http://doc.trolltech.com/qthelpproject.html#virtual-folders\r\n\r\nQHP_VIRTUAL_" +
                    "FOLDER     = doc\r\n\r\n# If QHP_CUST_FILTER_NAME is set, it specifies the name of a" +
                    " custom filter to \r\n# add. For more information please see \r\n# http://doc.trollt" +
                    "ech.com/qthelpproject.html#custom-filters\r\n\r\nQHP_CUST_FILTER_NAME   = \r\n\r\n# The " +
                    "QHP_CUST_FILT_ATTRS tag specifies the list of the attributes of the \r\n# custom f" +
                    "ilter to add. For more information please see \r\n# <a href=\"http://doc.trolltech." +
                    "com/qthelpproject.html#custom-filters\"> \r\n# Qt Help Project / Custom Filters</a>" +
                    ".\r\n\r\nQHP_CUST_FILTER_ATTRS  = \r\n\r\n# The QHP_SECT_FILTER_ATTRS tag specifies the " +
                    "list of the attributes this \r\n# project\'s \r\n# filter section matches. \r\n# <a hre" +
                    "f=\"http://doc.trolltech.com/qthelpproject.html#filter-attributes\"> \r\n# Qt Help P" +
                    "roject / Filter Attributes</a>.\r\n\r\nQHP_SECT_FILTER_ATTRS  = \r\n\r\n# If the GENERAT" +
                    "E_QHP tag is set to YES, the QHG_LOCATION tag can \r\n# be used to specify the loc" +
                    "ation of Qt\'s qhelpgenerator. \r\n# If non-empty doxygen will try to run qhelpgene" +
                    "rator on the generated \r\n# .qhp file.\r\n\r\nQHG_LOCATION           = \r\n\r\n# If the G" +
                    "ENERATE_ECLIPSEHELP tag is set to YES, additional index files  \r\n# will be gener" +
                    "ated, which together with the HTML files, form an Eclipse help \r\n# plugin. To in" +
                    "stall this plugin and make it available under the help contents \r\n# menu in Ecli" +
                    "pse, the contents of the directory containing the HTML and XML \r\n# files needs t" +
                    "o be copied into the plugins directory of eclipse. The name of \r\n# the directory" +
                    " within the plugins directory should be the same as \r\n# the ECLIPSE_DOC_ID value" +
                    ". After copying Eclipse needs to be restarted before \r\n# the help appears.\r\n\r\nGE" +
                    "NERATE_ECLIPSEHELP   = NO\r\n\r\n# A unique identifier for the eclipse help plugin. " +
                    "When installing the plugin \r\n# the directory name containing the HTML and XML fi" +
                    "les should also have \r\n# this name.\r\n\r\nECLIPSE_DOC_ID         = org.doxygen.Proj" +
                    "ect\r\n\r\n# The DISABLE_INDEX tag can be used to turn on/off the condensed index (t" +
                    "abs) \r\n# at top of each HTML page. The value NO (the default) enables the index " +
                    "and \r\n# the value YES disables it. Since the tabs have the same information as t" +
                    "he \r\n# navigation tree you can set this option to NO if you already set \r\n# GENE" +
                    "RATE_TREEVIEW to YES.\r\n\r\nDISABLE_INDEX          = NO\r\n\r\n# The GENERATE_TREEVIEW " +
                    "tag is used to specify whether a tree-like index \r\n# structure should be generat" +
                    "ed to display hierarchical information. \r\n# If the tag value is set to YES, a si" +
                    "de panel will be generated \r\n# containing a tree-like index structure (just like" +
                    " the one that \r\n# is generated for HTML Help). For this to work a browser that s" +
                    "upports \r\n# JavaScript, DHTML, CSS and frames is required (i.e. any modern brows" +
                    "er). \r\n# Windows users are probably better off using the HTML help feature. \r\n# " +
                    "Since the tree basically has the same information as the tab index you \r\n# could" +
                    " consider to set DISABLE_INDEX to NO when enabling this option.\r\n\r\nGENERATE_TREE" +
                    "VIEW      = NO\r\n\r\n# The ENUM_VALUES_PER_LINE tag can be used to set the number o" +
                    "f enum values \r\n# (range [0,1..20]) that doxygen will group on one line in the g" +
                    "enerated HTML \r\n# documentation. Note that a value of 0 will completely suppress" +
                    " the enum \r\n# values from appearing in the overview section.\r\n\r\nENUM_VALUES_PER_" +
                    "LINE   = 4\r\n\r\n# If the treeview is enabled (see GENERATE_TREEVIEW) then this tag" +
                    " can be \r\n# used to set the initial width (in pixels) of the frame in which the " +
                    "tree \r\n# is shown.\r\n\r\nTREEVIEW_WIDTH         = 250\r\n\r\n# When the EXT_LINKS_IN_WI" +
                    "NDOW option is set to YES doxygen will open \r\n# links to external symbols import" +
                    "ed via tag files in a separate window.\r\n\r\nEXT_LINKS_IN_WINDOW    = NO\r\n\r\n# Use t" +
                    "his tag to change the font size of Latex formulas included \r\n# as images in the " +
                    "HTML documentation. The default is 10. Note that \r\n# when you change the font si" +
                    "ze after a successful doxygen run you need \r\n# to manually remove any form_*.png" +
                    " images from the HTML output directory \r\n# to force them to be regenerated.\r\n\r\nF" +
                    "ORMULA_FONTSIZE       = 10\r\n\r\n# Use the FORMULA_TRANPARENT tag to determine whet" +
                    "her or not the images \r\n# generated for formulas are transparent PNGs. Transpare" +
                    "nt PNGs are \r\n# not supported properly for IE 6.0, but are supported on all mode" +
                    "rn browsers. \r\n# Note that when changing this option you need to delete any form" +
                    "_*.png files \r\n# in the HTML output before the changes have effect.\r\n\r\nFORMULA_T" +
                    "RANSPARENT    = YES\r\n\r\n# Enable the USE_MATHJAX option to render LaTeX formulas " +
                    "using MathJax \r\n# (see http://www.mathjax.org) which uses client side Javascript" +
                    " for the \r\n# rendering instead of using prerendered bitmaps. Use this if you do " +
                    "not \r\n# have LaTeX installed or if you want to formulas look prettier in the HTM" +
                    "L \r\n# output. When enabled you may also need to install MathJax separately and \r" +
                    "\n# configure the path to it using the MATHJAX_RELPATH option.\r\n\r\nUSE_MATHJAX    " +
                    "        = NO\r\n\r\n# When MathJax is enabled you need to specify the location relat" +
                    "ive to the \r\n# HTML output directory using the MATHJAX_RELPATH option. The desti" +
                    "nation \r\n# directory should contain the MathJax.js script. For instance, if the " +
                    "mathjax \r\n# directory is located at the same level as the HTML output directory," +
                    " then \r\n# MATHJAX_RELPATH should be ../mathjax. The default value points to \r\n# " +
                    "the MathJax Content Delivery Network so you can quickly see the result without \r" +
                    "\n# installing MathJax.  However, it is strongly recommended to install a local \r" +
                    "\n# copy of MathJax from http://www.mathjax.org before deployment.\r\n\r\nMATHJAX_REL" +
                    "PATH        = http://cdn.mathjax.org/mathjax/latest\r\n\r\n# The MATHJAX_EXTENSIONS " +
                    "tag can be used to specify one or MathJax extension \r\n# names that should be ena" +
                    "bled during MathJax rendering.\r\n\r\nMATHJAX_EXTENSIONS     = \r\n\r\n# When the SEARCH" +
                    "ENGINE tag is enabled doxygen will generate a search box \r\n# for the HTML output" +
                    ". The underlying search engine uses javascript \r\n# and DHTML and should work on " +
                    "any modern browser. Note that when using \r\n# HTML help (GENERATE_HTMLHELP), Qt h" +
                    "elp (GENERATE_QHP), or docsets \r\n# (GENERATE_DOCSET) there is already a search f" +
                    "unction so this one should \r\n# typically be disabled. For large projects the jav" +
                    "ascript based search engine \r\n# can be slow, then enabling SERVER_BASED_SEARCH m" +
                    "ay provide a better solution.\r\n\r\nSEARCHENGINE           = YES\r\n\r\n# When the SERV" +
                    "ER_BASED_SEARCH tag is enabled the search engine will be \r\n# implemented using a" +
                    " PHP enabled web server instead of at the web client \r\n# using Javascript. Doxyg" +
                    "en will generate the search PHP script and index \r\n# file to put on the web serv" +
                    "er. The advantage of the server \r\n# based approach is that it scales better to l" +
                    "arge projects and allows \r\n# full text search. The disadvantages are that it is " +
                    "more difficult to setup \r\n# and does not have live searching capabilities.\r\n\r\nSE" +
                    "RVER_BASED_SEARCH    = NO\r\n\r\n#--------------------------------------------------" +
                    "-------------------------\r\n# configuration options related to the LaTeX output\r\n" +
                    "#---------------------------------------------------------------------------\r\n\r\n" +
                    "# If the GENERATE_LATEX tag is set to YES (the default) Doxygen will \r\n# generat" +
                    "e Latex output.\r\n\r\nGENERATE_LATEX         = NO\r\n\r\n# The LATEX_OUTPUT tag is used" +
                    " to specify where the LaTeX docs will be put. \r\n# If a relative path is entered " +
                    "the value of OUTPUT_DIRECTORY will be \r\n# put in front of it. If left blank `lat" +
                    "ex\' will be used as the default path.\r\n\r\nLATEX_OUTPUT           = latex\r\n\r\n# The" +
                    " LATEX_CMD_NAME tag can be used to specify the LaTeX command name to be \r\n# invo" +
                    "ked. If left blank `latex\' will be used as the default command name. \r\n# Note th" +
                    "at when enabling USE_PDFLATEX this option is only used for \r\n# generating bitmap" +
                    "s for formulas in the HTML output, but not in the \r\n# Makefile that is written t" +
                    "o the output directory.\r\n\r\nLATEX_CMD_NAME         = latex\r\n\r\n# The MAKEINDEX_CMD" +
                    "_NAME tag can be used to specify the command name to \r\n# generate index for LaTe" +
                    "X. If left blank `makeindex\' will be used as the \r\n# default command name.\r\n\r\nMA" +
                    "KEINDEX_CMD_NAME     = makeindex\r\n\r\n# If the COMPACT_LATEX tag is set to YES Dox" +
                    "ygen generates more compact \r\n# LaTeX documents. This may be useful for small pr" +
                    "ojects and may help to \r\n# save some trees in general.\r\n\r\nCOMPACT_LATEX         " +
                    " = NO\r\n\r\n# The PAPER_TYPE tag can be used to set the paper type that is used \r\n#" +
                    " by the printer. Possible values are: a4, letter, legal and \r\n# executive. If le" +
                    "ft blank a4wide will be used.\r\n\r\nPAPER_TYPE             = a4\r\n\r\n# The EXTRA_PACK" +
                    "AGES tag can be to specify one or more names of LaTeX \r\n# packages that should b" +
                    "e included in the LaTeX output.\r\n\r\nEXTRA_PACKAGES         = \r\n\r\n# The LATEX_HEAD" +
                    "ER tag can be used to specify a personal LaTeX header for \r\n# the generated late" +
                    "x document. The header should contain everything until \r\n# the first chapter. If" +
                    " it is left blank doxygen will generate a \r\n# standard header. Notice: only use " +
                    "this tag if you know what you are doing!\r\n\r\nLATEX_HEADER           = \r\n\r\n# The L" +
                    "ATEX_FOOTER tag can be used to specify a personal LaTeX footer for \r\n# the gener" +
                    "ated latex document. The footer should contain everything after \r\n# the last cha" +
                    "pter. If it is left blank doxygen will generate a \r\n# standard footer. Notice: o" +
                    "nly use this tag if you know what you are doing!\r\n\r\nLATEX_FOOTER           = \r\n\r" +
                    "\n# If the PDF_HYPERLINKS tag is set to YES, the LaTeX that is generated \r\n# is p" +
                    "repared for conversion to pdf (using ps2pdf). The pdf file will \r\n# contain link" +
                    "s (just like the HTML output) instead of page references \r\n# This makes the outp" +
                    "ut suitable for online browsing using a pdf viewer.\r\n\r\nPDF_HYPERLINKS         = " +
                    "YES\r\n\r\n# If the USE_PDFLATEX tag is set to YES, pdflatex will be used instead of" +
                    " \r\n# plain latex in the generated Makefile. Set this option to YES to get a \r\n# " +
                    "higher quality PDF documentation.\r\n\r\nUSE_PDFLATEX           = YES\r\n\r\n# If the LA" +
                    "TEX_BATCHMODE tag is set to YES, doxygen will add the \\\\batchmode. \r\n# command t" +
                    "o the generated LaTeX files. This will instruct LaTeX to keep \r\n# running if err" +
                    "ors occur, instead of asking the user for help. \r\n# This option is also used whe" +
                    "n generating formulas in HTML.\r\n\r\nLATEX_BATCHMODE        = NO\r\n\r\n# If LATEX_HIDE" +
                    "_INDICES is set to YES then doxygen will not \r\n# include the index chapters (suc" +
                    "h as File Index, Compound Index, etc.) \r\n# in the output.\r\n\r\nLATEX_HIDE_INDICES " +
                    "    = NO\r\n\r\n# If LATEX_SOURCE_CODE is set to YES then doxygen will include \r\n# s" +
                    "ource code with syntax highlighting in the LaTeX output. \r\n# Note that which sou" +
                    "rces are shown also depends on other settings \r\n# such as SOURCE_BROWSER.\r\n\r\nLAT" +
                    "EX_SOURCE_CODE      = NO\r\n\r\n# The LATEX_BIB_STYLE tag can be used to specify the" +
                    " style to use for the \r\n# bibliography, e.g. plainnat, or ieeetr. The default st" +
                    "yle is \"plain\". See \r\n# http://en.wikipedia.org/wiki/BibTeX for more info.\r\n\r\nLA" +
                    "TEX_BIB_STYLE        = plain\r\n\r\n#-----------------------------------------------" +
                    "----------------------------\r\n# configuration options related to the RTF output\r" +
                    "\n#---------------------------------------------------------------------------\r\n\r" +
                    "\n# If the GENERATE_RTF tag is set to YES Doxygen will generate RTF output \r\n# Th" +
                    "e RTF output is optimized for Word 97 and may not look very pretty with \r\n# othe" +
                    "r RTF readers or editors.\r\n\r\nGENERATE_RTF           = NO\r\n\r\n# The RTF_OUTPUT tag" +
                    " is used to specify where the RTF docs will be put. \r\n# If a relative path is en" +
                    "tered the value of OUTPUT_DIRECTORY will be \r\n# put in front of it. If left blan" +
                    "k `rtf\' will be used as the default path.\r\n\r\nRTF_OUTPUT             = rtf\r\n\r\n# I" +
                    "f the COMPACT_RTF tag is set to YES Doxygen generates more compact \r\n# RTF docum" +
                    "ents. This may be useful for small projects and may help to \r\n# save some trees " +
                    "in general.\r\n\r\nCOMPACT_RTF            = NO\r\n\r\n# If the RTF_HYPERLINKS tag is set" +
                    " to YES, the RTF that is generated \r\n# will contain hyperlink fields. The RTF fi" +
                    "le will \r\n# contain links (just like the HTML output) instead of page references" +
                    ". \r\n# This makes the output suitable for online browsing using WORD or other \r\n#" +
                    " programs which support those fields. \r\n# Note: wordpad (write) and others do no" +
                    "t support links.\r\n\r\nRTF_HYPERLINKS         = NO\r\n\r\n# Load style sheet definition" +
                    "s from file. Syntax is similar to doxygen\'s \r\n# config file, i.e. a series of as" +
                    "signments. You only have to provide \r\n# replacements, missing definitions are se" +
                    "t to their default value.\r\n\r\nRTF_STYLESHEET_FILE    = \r\n\r\n# Set optional variabl" +
                    "es used in the generation of an rtf document. \r\n# Syntax is similar to doxygen\'s" +
                    " config file.\r\n\r\nRTF_EXTENSIONS_FILE    = \r\n\r\n#---------------------------------" +
                    "------------------------------------------\r\n# configuration options related to t" +
                    "he man page output\r\n#-----------------------------------------------------------" +
                    "----------------\r\n\r\n# If the GENERATE_MAN tag is set to YES (the default) Doxyge" +
                    "n will \r\n# generate man pages\r\n\r\nGENERATE_MAN           = NO\r\n\r\n# The MAN_OUTPUT" +
                    " tag is used to specify where the man pages will be put. \r\n# If a relative path " +
                    "is entered the value of OUTPUT_DIRECTORY will be \r\n# put in front of it. If left" +
                    " blank `man\' will be used as the default path.\r\n\r\nMAN_OUTPUT             = man\r\n" +
                    "\r\n# The MAN_EXTENSION tag determines the extension that is added to \r\n# the gene" +
                    "rated man pages (default is the subroutine\'s section .3)\r\n\r\nMAN_EXTENSION       " +
                    "   = .3\r\n\r\n# If the MAN_LINKS tag is set to YES and Doxygen generates man output" +
                    ", \r\n# then it will generate one additional man file for each entity \r\n# document" +
                    "ed in the real man page(s). These additional files \r\n# only source the real man " +
                    "page, but without them the man command \r\n# would be unable to find the correct p" +
                    "age. The default is NO.\r\n\r\nMAN_LINKS              = NO\r\n\r\n#---------------------" +
                    "------------------------------------------------------\r\n# configuration options " +
                    "related to the XML output\r\n#----------------------------------------------------" +
                    "-----------------------\r\n\r\n# If the GENERATE_XML tag is set to YES Doxygen will " +
                    "\r\n# generate an XML file that captures the structure of \r\n# the code including a" +
                    "ll documentation.\r\n\r\nGENERATE_XML           = YES\r\n\r\n# The XML_OUTPUT tag is use" +
                    "d to specify where the XML pages will be put. \r\n# If a relative path is entered " +
                    "the value of OUTPUT_DIRECTORY will be \r\n# put in front of it. If left blank `xml" +
                    "\' will be used as the default path.\r\n\r\nXML_OUTPUT             = xml\r\n\r\n# The XML" +
                    "_SCHEMA tag can be used to specify an XML schema, \r\n# which can be used by a val" +
                    "idating XML parser to check the \r\n# syntax of the XML files.\r\n\r\nXML_SCHEMA      " +
                    "       = \r\n\r\n# The XML_DTD tag can be used to specify an XML DTD, \r\n# which can " +
                    "be used by a validating XML parser to check the \r\n# syntax of the XML files.\r\n\r\n" +
                    "XML_DTD                = \r\n\r\n# If the XML_PROGRAMLISTING tag is set to YES Doxyg" +
                    "en will \r\n# dump the program listings (including syntax highlighting \r\n# and cro" +
                    "ss-referencing information) to the XML output. Note that \r\n# enabling this will " +
                    "significantly increase the size of the XML output.\r\n\r\nXML_PROGRAMLISTING     = N" +
                    "O\r\n\r\n#--------------------------------------------------------------------------" +
                    "-\r\n# configuration options for the AutoGen Definitions output\r\n#----------------" +
                    "-----------------------------------------------------------\r\n\r\n# If the GENERATE" +
                    "_AUTOGEN_DEF tag is set to YES Doxygen will \r\n# generate an AutoGen Definitions " +
                    "(see autogen.sf.net) file \r\n# that captures the structure of the code including " +
                    "all \r\n# documentation. Note that this feature is still experimental \r\n# and inco" +
                    "mplete at the moment.\r\n\r\nGENERATE_AUTOGEN_DEF   = NO\r\n\r\n#-----------------------" +
                    "----------------------------------------------------\r\n# configuration options re" +
                    "lated to the Perl module output\r\n#----------------------------------------------" +
                    "-----------------------------\r\n\r\n# If the GENERATE_PERLMOD tag is set to YES Dox" +
                    "ygen will \r\n# generate a Perl module file that captures the structure of \r\n# the" +
                    " code including all documentation. Note that this \r\n# feature is still experimen" +
                    "tal and incomplete at the \r\n# moment.\r\n\r\nGENERATE_PERLMOD       = NO\r\n\r\n# If the" +
                    " PERLMOD_LATEX tag is set to YES Doxygen will generate \r\n# the necessary Makefil" +
                    "e rules, Perl scripts and LaTeX code to be able \r\n# to generate PDF and DVI outp" +
                    "ut from the Perl module output.\r\n\r\nPERLMOD_LATEX          = NO\r\n\r\n# If the PERLM" +
                    "OD_PRETTY tag is set to YES the Perl module output will be \r\n# nicely formatted " +
                    "so it can be parsed by a human reader.  This is useful \r\n# if you want to unders" +
                    "tand what is going on.  On the other hand, if this \r\n# tag is set to NO the size" +
                    " of the Perl module output will be much smaller \r\n# and Perl will parse it just " +
                    "the same.\r\n\r\nPERLMOD_PRETTY         = YES\r\n\r\n# The names of the make variables i" +
                    "n the generated doxyrules.make file \r\n# are prefixed with the string contained i" +
                    "n PERLMOD_MAKEVAR_PREFIX. \r\n# This is useful so different doxyrules.make files i" +
                    "ncluded by the same \r\n# Makefile don\'t overwrite each other\'s variables.\r\n\r\nPERL" +
                    "MOD_MAKEVAR_PREFIX = \r\n\r\n#------------------------------------------------------" +
                    "---------------------\r\n# Configuration options related to the preprocessor\r\n#---" +
                    "------------------------------------------------------------------------\r\n\r\n# If" +
                    " the ENABLE_PREPROCESSING tag is set to YES (the default) Doxygen will \r\n# evalu" +
                    "ate all C-preprocessor directives found in the sources and include \r\n# files.\r\n\r" +
                    "\nENABLE_PREPROCESSING   = YES\r\n\r\n# If the MACRO_EXPANSION tag is set to YES Doxy" +
                    "gen will expand all macro \r\n# names in the source code. If set to NO (the defaul" +
                    "t) only conditional \r\n# compilation will be performed. Macro expansion can be do" +
                    "ne in a controlled \r\n# way by setting EXPAND_ONLY_PREDEF to YES.\r\n\r\nMACRO_EXPANS" +
                    "ION        = YES\r\n\r\n# If the EXPAND_ONLY_PREDEF and MACRO_EXPANSION tags are bot" +
                    "h set to YES \r\n# then the macro expansion is limited to the macros specified wit" +
                    "h the \r\n# PREDEFINED and EXPAND_AS_DEFINED tags.\r\n\r\nEXPAND_ONLY_PREDEF     = NO\r" +
                    "\n\r\n# If the SEARCH_INCLUDES tag is set to YES (the default) the includes files \r" +
                    "\n# pointed to by INCLUDE_PATH will be searched when a #include is found.\r\n\r\nSEAR" +
                    "CH_INCLUDES        = YES\r\n\r\n# The INCLUDE_PATH tag can be used to specify one or" +
                    " more directories that \r\n# contain include files that are not input files but sh" +
                    "ould be processed by \r\n# the preprocessor.\r\n\r\nINCLUDE_PATH           = \r\n\r\n# You" +
                    " can use the INCLUDE_FILE_PATTERNS tag to specify one or more wildcard \r\n# patte" +
                    "rns (like *.h and *.hpp) to filter out the header-files in the \r\n# directories. " +
                    "If left blank, the patterns specified with FILE_PATTERNS will \r\n# be used.\r\n\r\nIN" +
                    "CLUDE_FILE_PATTERNS  = \r\n\r\n# The PREDEFINED tag can be used to specify one or mo" +
                    "re macro names that \r\n# are defined before the preprocessor is started (similar " +
                    "to the -D option of \r\n# gcc). The argument of the tag is a list of macros of the" +
                    " form: name \r\n# or name=definition (no spaces). If the definition and the = are " +
                    "\r\n# omitted =1 is assumed. To prevent a macro definition from being \r\n# undefine" +
                    "d via #undef or recursively expanded use the := operator \r\n# instead of the = op" +
                    "erator.\r\n\r\nPREDEFINED             = \r\n\r\n# If the MACRO_EXPANSION and EXPAND_ONLY" +
                    "_PREDEF tags are set to YES then \r\n# this tag can be used to specify a list of m" +
                    "acro names that should be expanded. \r\n# The macro definition that is found in th" +
                    "e sources will be used. \r\n# Use the PREDEFINED tag if you want to use a differen" +
                    "t macro definition that \r\n# overrules the definition found in the source code.\r\n" +
                    "\r\nEXPAND_AS_DEFINED      = \r\n\r\n# If the SKIP_FUNCTION_MACROS tag is set to YES (" +
                    "the default) then \r\n# doxygen\'s preprocessor will remove all references to funct" +
                    "ion-like macros \r\n# that are alone on a line, have an all uppercase name, and do" +
                    " not end with a \r\n# semicolon, because these will confuse the parser if not remo" +
                    "ved.\r\n\r\nSKIP_FUNCTION_MACROS   = YES\r\n\r\n#---------------------------------------" +
                    "------------------------------------\r\n# Configuration::additions related to exte" +
                    "rnal references\r\n#--------------------------------------------------------------" +
                    "-------------\r\n\r\n# The TAGFILES option can be used to specify one or more tagfil" +
                    "es. For each \r\n# tag file the location of the external documentation should be a" +
                    "dded. The \r\n# format of a tag file without this location is as follows: \r\n#   TA" +
                    "GFILES = file1 file2 ... \r\n# Adding location for the tag files is done as follow" +
                    "s: \r\n#   TAGFILES = file1=loc1 \"file2 = loc2\" ... \r\n# where \"loc1\" and \"loc2\" ca" +
                    "n be relative or absolute paths \r\n# or URLs. Note that each tag file must have a" +
                    " unique name (where the name does \r\n# NOT include the path). If a tag file is no" +
                    "t located in the directory in which \r\n# doxygen is run, you must also specify th" +
                    "e path to the tagfile here.\r\n\r\nTAGFILES               = \r\n\r\n# When a file name i" +
                    "s specified after GENERATE_TAGFILE, doxygen will create \r\n# a tag file that is b" +
                    "ased on the input files it reads.\r\n\r\nGENERATE_TAGFILE       =\r\n\r\n# If the ALLEXT" +
                    "ERNALS tag is set to YES all external classes will be listed \r\n# in the class in" +
                    "dex. If set to NO only the inherited external classes \r\n# will be listed.\r\n\r\nALL" +
                    "EXTERNALS           = NO\r\n\r\n# If the EXTERNAL_GROUPS tag is set to YES all exter" +
                    "nal groups will be listed \r\n# in the modules index. If set to NO, only the curre" +
                    "nt project\'s groups will \r\n# be listed.\r\n\r\nEXTERNAL_GROUPS        = YES\r\n\r\n# The" +
                    " PERL_PATH should be the absolute path and name of the perl script \r\n# interpret" +
                    "er (i.e. the result of `which perl\').\r\n\r\nPERL_PATH              = /usr/bin/perl\r" +
                    "\n\r\n#---------------------------------------------------------------------------\r" +
                    "\n# Configuration options related to the dot tool\r\n#-----------------------------" +
                    "----------------------------------------------\r\n\r\n# If the CLASS_DIAGRAMS tag is" +
                    " set to YES (the default) Doxygen will \r\n# generate a inheritance diagram (in HT" +
                    "ML, RTF and LaTeX) for classes with base \r\n# or super classes. Setting the tag t" +
                    "o NO turns the diagrams off. Note that \r\n# this option also works with HAVE_DOT " +
                    "disabled, but it is recommended to \r\n# install and use dot, since it yields more" +
                    " powerful graphs.\r\n\r\nCLASS_DIAGRAMS         = NO\r\n\r\n# You can define message seq" +
                    "uence charts within doxygen comments using the \\msc \r\n# command. Doxygen will th" +
                    "en run the mscgen tool (see \r\n# http://www.mcternan.me.uk/mscgen/) to produce th" +
                    "e chart and insert it in the \r\n# documentation. The MSCGEN_PATH tag allows you t" +
                    "o specify the directory where \r\n# the mscgen tool resides. If left empty the too" +
                    "l is assumed to be found in the \r\n# default search path.\r\n\r\nMSCGEN_PATH         " +
                    "   = \r\n\r\n# If set to YES, the inheritance and collaboration graphs will hide \r\n#" +
                    " inheritance and usage relations if the target is undocumented \r\n# or is not a c" +
                    "lass.\r\n\r\nHIDE_UNDOC_RELATIONS   = YES\r\n\r\n# If you set the HAVE_DOT tag to YES th" +
                    "en doxygen will assume the dot tool is \r\n# available from the path. This tool is" +
                    " part of Graphviz, a graph visualization \r\n# toolkit from AT&T and Lucent Bell L" +
                    "abs. The other options in this section \r\n# have no effect if this option is set " +
                    "to NO (the default)\r\n\r\nHAVE_DOT               = YES\r\n\r\n# The DOT_NUM_THREADS spe" +
                    "cifies the number of dot invocations doxygen is \r\n# allowed to run in parallel. " +
                    "When set to 0 (the default) doxygen will \r\n# base this on the number of processo" +
                    "rs available in the system. You can set it \r\n# explicitly to a value larger than" +
                    " 0 to get control over the balance \r\n# between CPU load and processing speed.\r\n\r" +
                    "\nDOT_NUM_THREADS        = 0\r\n\r\n# By default doxygen will use the Helvetica font " +
                    "for all dot files that \r\n# doxygen generates. When you want a differently lookin" +
                    "g font you can specify \r\n# the font name using DOT_FONTNAME. You need to make su" +
                    "re dot is able to find \r\n# the font, which can be done by putting it in a standa" +
                    "rd location or by setting \r\n# the DOTFONTPATH environment variable or by setting" +
                    " DOT_FONTPATH to the \r\n# directory containing the font.\r\n\r\nDOT_FONTNAME         " +
                    "  = Helvetica\r\n\r\n# The DOT_FONTSIZE tag can be used to set the size of the font " +
                    "of dot graphs. \r\n# The default size is 10pt.\r\n\r\nDOT_FONTSIZE           = 10\r\n\r\n#" +
                    " By default doxygen will tell dot to use the Helvetica font. \r\n# If you specify " +
                    "a different font using DOT_FONTNAME you can use DOT_FONTPATH to \r\n# set the path" +
                    " where dot can find it.\r\n\r\nDOT_FONTPATH           = \r\n\r\n# If the CLASS_GRAPH and" +
                    " HAVE_DOT tags are set to YES then doxygen \r\n# will generate a graph for each do" +
                    "cumented class showing the direct and \r\n# indirect inheritance relations. Settin" +
                    "g this tag to YES will force the \r\n# CLASS_DIAGRAMS tag to NO.\r\n\r\nCLASS_GRAPH   " +
                    "         = YES\r\n\r\n# If the COLLABORATION_GRAPH and HAVE_DOT tags are set to YES " +
                    "then doxygen \r\n# will generate a graph for each documented class showing the dir" +
                    "ect and \r\n# indirect implementation dependencies (inheritance, containment, and " +
                    "\r\n# class references variables) of the class with other documented classes.\r\n\r\nC" +
                    "OLLABORATION_GRAPH    = NO\r\n\r\n# If the GROUP_GRAPHS and HAVE_DOT tags are set to" +
                    " YES then doxygen \r\n# will generate a graph for groups, showing the direct group" +
                    "s dependencies\r\n\r\nGROUP_GRAPHS           = YES\r\n\r\n# If the UML_LOOK tag is set t" +
                    "o YES doxygen will generate inheritance and \r\n# collaboration diagrams in a styl" +
                    "e similar to the OMG\'s Unified Modeling \r\n# Language.\r\n\r\nUML_LOOK               " +
                    "= NO\r\n\r\n# If the UML_LOOK tag is enabled, the fields and methods are shown insid" +
                    "e \r\n# the class node. If there are many fields or methods and many nodes the \r\n#" +
                    " graph may become too big to be useful. The UML_LIMIT_NUM_FIELDS \r\n# threshold l" +
                    "imits the number of items for each type to make the size more \r\n# managable. Set" +
                    " this to 0 for no limit. Note that the threshold may be \r\n# exceeded by 50% befo" +
                    "re the limit is enforced.\r\n\r\nUML_LIMIT_NUM_FIELDS   = 10\r\n\r\n# If set to YES, the" +
                    " inheritance and collaboration graphs will show the \r\n# relations between templa" +
                    "tes and their instances.\r\n\r\nTEMPLATE_RELATIONS     = NO\r\n\r\n# If the ENABLE_PREPR" +
                    "OCESSING, SEARCH_INCLUDES, INCLUDE_GRAPH, and HAVE_DOT \r\n# tags are set to YES t" +
                    "hen doxygen will generate a graph for each documented \r\n# file showing the direc" +
                    "t and indirect include dependencies of the file with \r\n# other documented files." +
                    "\r\n\r\nINCLUDE_GRAPH          = NO\r\n\r\n# If the ENABLE_PREPROCESSING, SEARCH_INCLUDE" +
                    "S, INCLUDED_BY_GRAPH, and \r\n# HAVE_DOT tags are set to YES then doxygen will gen" +
                    "erate a graph for each \r\n# documented header file showing the documented files t" +
                    "hat directly or \r\n# indirectly include this file.\r\n\r\nINCLUDED_BY_GRAPH      = NO" +
                    "\r\n\r\n# If the CALL_GRAPH and HAVE_DOT options are set to YES then \r\n# doxygen wil" +
                    "l generate a call dependency graph for every global function \r\n# or class method" +
                    ". Note that enabling this option will significantly increase \r\n# the time of a r" +
                    "un. So in most cases it will be better to enable call graphs \r\n# for selected fu" +
                    "nctions only using the \\callgraph command.\r\n\r\nCALL_GRAPH             = NO\r\n\r\n# I" +
                    "f the CALLER_GRAPH and HAVE_DOT tags are set to YES then \r\n# doxygen will genera" +
                    "te a caller dependency graph for every global function \r\n# or class method. Note" +
                    " that enabling this option will significantly increase \r\n# the time of a run. So" +
                    " in most cases it will be better to enable caller \r\n# graphs for selected functi" +
                    "ons only using the \\callergraph command.\r\n\r\nCALLER_GRAPH           = NO\r\n\r\n# If " +
                    "the GRAPHICAL_HIERARCHY and HAVE_DOT tags are set to YES then doxygen \r\n# will g" +
                    "enerate a graphical hierarchy of all classes instead of a textual one.\r\n\r\nGRAPHI" +
                    "CAL_HIERARCHY    = NO\r\n\r\n# If the DIRECTORY_GRAPH and HAVE_DOT tags are set to Y" +
                    "ES \r\n# then doxygen will show the dependencies a directory has on other director" +
                    "ies \r\n# in a graphical way. The dependency relations are determined by the #incl" +
                    "ude \r\n# relations between the files in the directories.\r\n\r\nDIRECTORY_GRAPH      " +
                    "  = YES\r\n\r\n# The DOT_IMAGE_FORMAT tag can be used to set the image format of the" +
                    " images \r\n# generated by dot. Possible values are svg, png, jpg, or gif. \r\n# If " +
                    "left blank png will be used. If you choose svg you need to set \r\n# HTML_FILE_EXT" +
                    "ENSION to xhtml in order to make the SVG files \r\n# visible in IE 9+ (other brows" +
                    "ers do not have this requirement).\r\n\r\nDOT_IMAGE_FORMAT       = png\r\n\r\n# If DOT_I" +
                    "MAGE_FORMAT is set to svg, then this option can be set to YES to \r\n# enable gene" +
                    "ration of interactive SVG images that allow zooming and panning. \r\n# Note that t" +
                    "his requires a modern browser other than Internet Explorer. \r\n# Tested and worki" +
                    "ng are Firefox, Chrome, Safari, and Opera. For IE 9+ you \r\n# need to set HTML_FI" +
                    "LE_EXTENSION to xhtml in order to make the SVG files \r\n# visible. Older versions" +
                    " of IE do not have SVG support.\r\n\r\nINTERACTIVE_SVG        = NO\r\n\r\n# The tag DOT_" +
                    "PATH can be used to specify the path where the dot tool can be \r\n# found. If lef" +
                    "t blank, it is assumed the dot tool can be found in the path.\r\n\r\nDOT_PATH       " +
                    "        = \r\n\r\n# The DOTFILE_DIRS tag can be used to specify one or more director" +
                    "ies that \r\n# contain dot files that are included in the documentation (see the \r" +
                    "\n# \\dotfile command).\r\n\r\nDOTFILE_DIRS           = \r\n\r\n# The MSCFILE_DIRS tag can" +
                    " be used to specify one or more directories that \r\n# contain msc files that are " +
                    "included in the documentation (see the \r\n# \\mscfile command).\r\n\r\nMSCFILE_DIRS   " +
                    "        = \r\n\r\n# The DOT_GRAPH_MAX_NODES tag can be used to set the maximum numbe" +
                    "r of \r\n# nodes that will be shown in the graph. If the number of nodes in a grap" +
                    "h \r\n# becomes larger than this value, doxygen will truncate the graph, which is " +
                    "\r\n# visualized by representing a node as a red box. Note that doxygen if the \r\n#" +
                    " number of direct children of the root node in a graph is already larger than \r\n" +
                    "# DOT_GRAPH_MAX_NODES then the graph will not be shown at all. Also note \r\n# tha" +
                    "t the size of a graph can be further restricted by MAX_DOT_GRAPH_DEPTH.\r\n\r\nDOT_G" +
                    "RAPH_MAX_NODES    = 50\r\n\r\n# The MAX_DOT_GRAPH_DEPTH tag can be used to set the m" +
                    "aximum depth of the \r\n# graphs generated by dot. A depth value of 3 means that o" +
                    "nly nodes reachable \r\n# from the root by following a path via at most 3 edges wi" +
                    "ll be shown. Nodes \r\n# that lay further from the root node will be omitted. Note" +
                    " that setting this \r\n# option to 1 or 2 may greatly reduce the computation time " +
                    "needed for large \r\n# code bases. Also note that the size of a graph can be furth" +
                    "er restricted by \r\n# DOT_GRAPH_MAX_NODES. Using a depth of 0 means no depth rest" +
                    "riction.\r\n\r\nMAX_DOT_GRAPH_DEPTH    = 0\r\n\r\n# Set the DOT_TRANSPARENT tag to YES t" +
                    "o generate images with a transparent \r\n# background. This is disabled by default" +
                    ", because dot on Windows does not \r\n# seem to support this out of the box. Warni" +
